        backgroundImage : 'url(' + image + ')', 
        backgroundPosition : 'center',
        backgroundSize : 'cover'
    }

    if(dataFromServer == null){
        <button className = "btn" style={modalButton}>Test</button>
    }

    return (
       <button className = "btn" style={modalButton} onClick={()=> onClick} >Test</button>
    )
}



export default CountryButton
